import React from 'react';
import classes from "./Header.module.css";
import logo from './logo.png';
import login from './log-in.png'; // Import the login icon image

const Header = () => {
  return (
    <header className={classes.Header}>
      <div className={classes.LogoContainer}>
        <img src={logo} alt="Logo" className={classes.Logo} />
      </div>
      <div className={classes.NavContainer}>
        <button className={classes.HeaderItem}>Home</button>
        <button className={classes.HeaderItem}>About Us</button>
        <button className={classes.HeaderItem}>Our Programs</button>
        <button className={classes.HeaderItem}>Our Partner</button>
        <button className={classes.HeaderItem}>Resources</button>
        <button className={classes.HeaderItem}>Contact</button>
        <button className={classes.HeaderItem}>Impact</button>
      </div>
      <div className={classes.SignUpContainer}>
        <button className={classes.SignUpButton}>
          <img src={login} alt="Login" className={classes.LoginIcon} /> {/* Use the login icon image */}
        </button>
      </div>
    </header>
  );
};

export default Header;
